import React, { useState } from "react";
import HomeIcon from "@material-ui/icons/Home";
import NavigationItem from "./NavigationItem/NavigationItem";
import "./NavigationsItems.css";
import LocalLibraryIcon from "@material-ui/icons/LocalLibrary";
import SchoolIcon from "@material-ui/icons/School";
import CalendarTodayIcon from "@material-ui/icons/CalendarToday";
import { NavLink } from "react-router-dom";
const NavigationItems = () => {
  const [menu, setMenu] = useState(true);

  const toggleEtudiantMenu = () => {
    setMenu((prev) => (prev = !prev));
  };

  return (
    <div className="NavigationItems">
      <NavLink style={{ textDecoration: "none" }}>
        <NavigationItem Icon={HomeIcon} title="Home" />
      </NavLink>
      <NavLink style={{ textDecoration: "none" }}>
        <NavigationItem Icon={LocalLibraryIcon} title="Librairie" />
      </NavLink>
      <NavLink style={{ textDecoration: "none" }}>
        <NavigationItem Icon={SchoolIcon} title="Etudiants" />
      </NavLink>
      <NavLink style={{ textDecoration: "none" }}>
        <NavigationItem Icon={CalendarTodayIcon} title="Calendrier" />
      </NavLink>
    </div>
  );
};

export default NavigationItems;
